import { StyleSheet } from 'react-native';
import { colors } from '../../../configuration';

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: colors.primaryB,
      alignItems: 'center',
      justifyContent: 'center',
    },
    text: {
        color : colors.white,
        marginRight: '15px',
        marginLeft: '15px',
    },
  });

export default styles
